const mongoose = require("mongoose");

//const Schema = mongoose.Schema();

const userSchema = new mongoose.Schema({
	email: {
		type: String,
		trim: true,
		required: true,
	},
	password: {
		type: String,
		required: true,
	},
	firstName: {
		type: String,
		trim: true,
		required: true,
	},
	lastName: {
		type: String,
		trim: true,
		required: false,
	},
	birthday: {
		type: Date,
		required: false,
	},
	phoneNumber: {
		type: String,
		required: false,
	},
	profileType: {
		type: String,
		required: true,
	},
});

//const Users = model("Users", userSchema);

module.exports = mongoose.models.User || mongoose.model("User", userSchema);
